/**
 * @name 스프라이트 계산
 * @author JungHyunKwon
 * @since 2018-09-05
 * @version 1.0.0
 * @param {number} size
 * @param {number} from
 * @param {number} to
 * @param {number} position
 * @return {object}
 */
try{!function(i){"use strict";window.calcSprite=function(i,e,t,o){var n={pixel:{size:0,position:0},percent:{size:0,position:0}};if(e=parseFloat(e,10),t=parseFloat(t,10),e>0&&t>0){var p=e/t;(i=parseFloat(i,10))>0&&(n.pixel.size=i/p,n.percent.size=n.pixel.size/t*100),(o=parseFloat(o,10))&&-1===o.toString().indexOf("Infinity")&&(n.pixel.position=o/p,n.percent.position=Math.abs(n.pixel.position/(n.pixel.size-t)*100))}return n}}()}catch(i){console.error(i)}